function initMap(minYear,maxYear, currentCenter, currentZoom, currentType) {

    var listOfKeys = Object.keys(demDict)
    var heatmapData = [];
    if (typeof minYear == 'undefined'){
        minYear = 1950;
    }
    if (typeof maxYear == 'undefined'){
        maxYear = 2000;
    }
    if (typeof currentCenter == 'undefined'){
        currentCenter = new google.maps.LatLng(0, 0);
    }
    if (typeof currentZoom == 'undefined'){
        currentZoom = 2;
    }
    if (typeof currentType == 'undefined'){
        currentType ='hybrid';
    }

    for (var j = 0;j < listOfKeys.length; j++){
        if (listOfKeys[j]< minYear || listOfKeys[j]>maxYear){
            continue;
        }
        var locations = demDict[listOfKeys[j]];
        for (var i = 0; i < locations.length; i+=2) {
            
            heatmapData.push(new google.maps.LatLng(locations[i], locations[i+1]))
        }
    }
    
map = new google.maps.Map(document.getElementById('map'), {
  center: currentCenter,
  zoom: currentZoom,
  mapTypeId: currentType
});
var heatmap = new google.maps.visualization.HeatmapLayer({
  data: heatmapData,
  maxIntensity : (heatmapData.length/100)
});
heatmap.setMap(map);
}


